window.bookSummaryJSON = "<p><b>Running a restaurant was hard, but it filled Clive’s life with meaning. Running through a portal was easy, but it filled Clive’s life with demons.</b></p> <p>Weak in a world full of strength, all he and his friends have is their grit and determination to survive as they navigate this brutal, war-torn land of magic in search of a way home.</p> <p>There’s a problem, though. Clive’s been cursed. A little stabby, stabby from a demonic knife catapults them into a race against time to find a cure. Fighting their way across Falritas, they need friends and levels like there’s no tomorrow. Because there might not be…</p> <p><i>God of the Feast</i> is a LitRPG/GameLit portal fantasy set in a chaotic land ruled by ruthless Gods, complete with game mechanics, progression system and empire-building. Despite their best efforts, the characters are driven by anger, fear, and lust, and as a result their journey is full of&nbsp;dark humor, violence, and profanity.</p>"; 
